   CONSTRAINT PK_BASE_ORG_GEO PRIMARY KEY (ORG_GEO_ID)
         ON "PRIMARY"
)
ON "PRIMARY"
go

/*==============================================================*/
/* Table: BASE_ORG_LOG                                          */
/*==============================================================*/
CREATE TABLE BASE_ORG_LOG (
   ID                   NUMERIC(10)          IDENTITY(1, 1),
   ORG_ID               NUMERIC(10)          NULL,
   PARENT_ORG_ID        NUMERIC(10)          NULL,
   ORG_TYPE_ID          NUMERIC(10)          NULL,
   EMP_ID               NUMERIC(10)          NULL,
   ORG_CODE             VARCHAR(100)         NULL,
   EXT_CODE             VARCHAR(32)          NULL,
   SUB_CODE             VARCHAR(32)          NULL,
   LEVEL_CODE           NUMERIC(2)           NULL,
   ORG_NAME             VARCHAR(100)         NULL,
   ORG_ALIAS            VARCHAR(100)         NULL,
   ORG_NAME_EN          VARCHAR(32)          NULL,
   PRINCIPAL            VARCHAR(100)         NULL,
   PHONE                VARCHAR(32)          NULL,
   FAX                  VARCHAR(32)          NULL,
   ORG_ADDR             VARCHAR(60)          NULL,
   POST_CODE            VARCHAR(32)          NULL,
   EMAIL                VARCHAR(32)          NULL,
   WEBSITE              VARCHAR(32)          NULL,
   MEMO1                VARCHAR(100)         NULL,
   MEMO2                VARCHAR(100)         NULL,
   MEMO3                VARCHAR(100)         NULL,
   REMARK               VARCHAR(500)         NULL,
   STATE                VARCHAR(2)           NULL,
   SORT                 NUMERIC(10)          NULL,
   CREATED_BY           VARCHAR(50)          NULL,
   CREATED              DATETIME             NULL,
   UPDATED_BY           VARCHAR(50)          NULL,
   UPDATED              DATETIME             NULL,
   PI1                  NUMERIC(10)          NULL,
   PI2                  NUMERIC(10)          NULL,
   PI3                  NUMERIC(10)          NULL,
   PI4                  NUMERIC(10)          NULL,
   PI5                  NUMERIC(10)          NULL,
   PI6                  NUMERIC(10)          NULL,
   PI7                  NUMERIC(10)          NULL,
   PI8                  NUMERIC(10)          NULL,
   PN1                  VARCHAR(100)         NULL,
   PN2                  VARCHAR(100)         NULL,
   PN3                  VARCHAR(100)         NULL,
   PN4                  VARCHAR(100)         NULL,
   PN5                  VARCHAR(100)         NULL,
   PN6                  VARCHAR(100)         NULL,
   PN7                  VARCHAR(100)         NULL,
   PN8                  VARCHAR(100)         NULL,
   PNALL                VARCHAR(200)         NULL,
   START_DATE           DATETIME             NULL,
   END_DATE             DATETIME             NULL,
   CONSTRAINT PK_BASE_ORG_LOG PRIMARY KEY (ID)
         ON "PRIMARY"
)
ON "PRIMARY"
go

/*==============================================================*/
