/*==============================================================*/
/* View: BASE_EMP_LIST                                          */
/*==============================================================*/
CREATE VIEW BASE_EMP_LIST AS
SELECT  
	EMP1.EMP_ID AS ID1, 
	EMP1.EMP_NAME AS NAME1,
	EMP1.SUB_CODE AS SUB_CODE1,
	EMP1.LEVEL_CODE AS LEVEL_CODE1,
	EMP2.EMP_ID AS ID2, 
	EMP2.EMP_NAME AS NAME2,
	EMP2.SUB_CODE AS SUB_CODE2,
	EMP2.LEVEL_CODE AS LEVEL_CODE2,
	EMP3.EMP_ID AS ID3, 
	EMP3.EMP_NAME AS NAME3,
	EMP3.SUB_CODE AS SUB_CODE3,
	EMP3.LEVEL_CODE AS LEVEL_CODE3,
	EMP4.EMP_ID AS ID4, 
	EMP4.EMP_NAME AS NAME4,
	EMP4.SUB_CODE AS SUB_CODE4,
	EMP4.LEVEL_CODE AS LEVEL_CODE4,
	EMP5.EMP_ID AS ID5, 
	EMP5.EMP_NAME AS NAME5,
	EMP5.SUB_CODE AS SUB_CODE5,
	EMP5.LEVEL_CODE AS LEVEL_CODE5,
	EMP6.EMP_ID AS ID6, 
	EMP6.EMP_NAME AS NAME6,
	EMP6.SUB_CODE AS SUB_CODE6,
	EMP6.LEVEL_CODE AS LEVEL_CODE6,
	EMP7.EMP_ID AS ID7, 
	EMP7.EMP_NAME AS NAME7,
	EMP7.SUB_CODE AS SUB_CODE7,
	EMP7.LEVEL_CODE AS LEVEL_CODE7,
	EMP8.EMP_ID AS ID8, 
	EMP8.EMP_NAME AS NAME8,
	EMP8.SUB_CODE AS SUB_CODE8,
	EMP8.LEVEL_CODE AS LEVEL_CODE8
	
FROM 
	(SELECT EMP_ID,EMP_NAME,SUB_CODE,LEVEL_CODE FROM BASE_EMPLOYEE WHERE LEVEL_CODE=1) EMP1 LEFT JOIN 
	BASE_EMPLOYEE EMP2 ON EMP1.EMP_ID=EMP2.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP3 ON EMP2.EMP_ID=EMP3.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP4 ON EMP3.EMP_ID=EMP4.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP5 ON EMP4.EMP_ID=EMP5.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP6 ON EMP5.EMP_ID=EMP6.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP7 ON EMP6.EMP_ID=EMP7.PARENT_EMP_ID LEFT JOIN
	BASE_EMPLOYEE EMP8 ON EMP7.EMP_ID=EMP8.PARENT_EMP_ID
go

/*==============================================================*/
/* View: BASE_GEO_MLIST                                         */
/*==============================================================*/
CREATE VIEW BASE_GEO_MLIST AS
SELECT 
	GEO.DICT_ITEM_ID AS DICT_ITEM_ID,
	GEO.SUB_CODE AS SUB_CODE,
	GEO.LEVEL_CODE AS LEVEL_CODE,
	
	ISNULL(GEO6.ITEM_NAME+'-','')
	+ISNULL(GEO5.ITEM_NAME+'-','')
	+ISNULL(GEO4.ITEM_NAME+'-','')
	+ISNULL(GEO3.ITEM_NAME+'-','')
	+ISNULL(GEO2.ITEM_NAME+'-','')
	+ISNULL(GEO1.ITEM_NAME+'-','') 
	+ISNULL(GEO.ITEM_NAME,'') 
	AS ITEM_NAME 
FROM BASE_DICT_ITEM GEO
	LEFT JOIN BASE_DICT_ITEM GEO1 ON GEO.PARENT_DICT_ITEM_ID=GEO1.DICT_ITEM_ID 
	LEFT JOIN BASE_DICT_ITEM GEO2 ON GEO1.PARENT_DICT_ITEM_ID=GEO2.DICT_ITEM_ID 
	LEFT JOIN BASE_DICT_ITEM GEO3 ON GEO2.PARENT_DICT_ITEM_ID=GEO3.DICT_ITEM_ID 
	LEFT JOIN BASE_DICT_ITEM GEO4 ON GEO3.PARENT_DICT_ITEM_ID=GEO4.DICT_ITEM_ID 
	LEFT JOIN BASE_DICT_ITEM GEO5 ON GEO4.PARENT_DICT_ITEM_ID=GEO5.DICT_ITEM_ID 
	LEFT JOIN BASE_DICT_ITEM GEO6 ON GEO5.PARENT_DICT_ITEM_ID=GEO6.DICT_ITEM_ID 
WHERE GEO.DICT_ID='geography'
go

