/*==============================================================*/
/* View: BASE_ORG_MLIST                                         */
/*==============================================================*/
CREATE VIEW BASE_ORG_MLIST AS
SELECT 
	ORG.ORG_ID AS ORG_ID,
	ORG.SUB_CODE AS SUB_CODE,
	ORG.LEVEL_CODE AS LEVEL_CODE,
	
	ISNULL(ORG6.ORG_NAME+'-','')
	+ISNULL(ORG5.ORG_NAME+'-','')
	+ISNULL(ORG4.ORG_NAME+'-','')
	+ISNULL(ORG3.ORG_NAME+'-','')
	+ISNULL(ORG2.ORG_NAME+'-','')
	+ISNULL(ORG1.ORG_NAME+'-','') 
	+ISNULL(ORG.ORG_NAME,'') 
	AS ORG_NAME 
FROM BASE_ORG ORG
	LEFT JOIN BASE_ORG ORG1 ON ORG.PARENT_ORG_ID=ORG1.ORG_ID 
	LEFT JOIN BASE_ORG ORG2 ON ORG1.PARENT_ORG_ID=ORG2.ORG_ID 
	LEFT JOIN BASE_ORG ORG3 ON ORG2.PARENT_ORG_ID=ORG3.ORG_ID 
	LEFT JOIN BASE_ORG ORG4 ON ORG3.PARENT_ORG_ID=ORG4.ORG_ID 
	LEFT JOIN BASE_ORG ORG5 ON ORG4.PARENT_ORG_ID=ORG5.ORG_ID 
	LEFT JOIN BASE_ORG ORG6 ON ORG5.PARENT_ORG_ID=ORG6.ORG_ID 
WHERE ORG.STATE='1'
go

